import { createNode } from './factory';

const LLMRender = ({ id, data }) => {
  return (
    <div>
      <div>
        <strong>LLM</strong>
      </div>
      <div>
        <span>This is an LLM node.</span>
      </div>
    </div>
  );
};

export const LLMNode = createNode({
  title: 'LLM',
  inputs: [
    { id: 'system' },
    { id: 'prompt' }
  ],
  outputs: [{ id: 'response' }],
  Render: LLMRender,
});
